import React from 'react';
import Home from './pages/Home';
import './App.css';
import {BrowserRouter, Link, Route, Routes} from "react-router-dom";

const App = () =>

            <BrowserRouter>
                <Routes>
                    <Route path="/"  element={<Home/>}/>



                </Routes>
            </BrowserRouter>

;

export default App;
